import React, { useState } from 'react';
import ItemsCarousel from 'react-items-carousel';
import vintage from '../assets/images/categories/vintage.png'
 
export default () => {
  const [activeItemIndex, setActiveItemIndex] = useState(0);
  const chevronWidth = 40;
  return (
    <div className="CategoriesContainer">
        <div style={{ padding: `0 ${chevronWidth}px` }}>
        <ItemsCarousel
            requestToChangeActive={setActiveItemIndex}
            activeItemIndex={activeItemIndex}
            numberOfCards={2}
            leftChevron={<button className="arrow" >{'<'}</button>}
            rightChevron={<button className="arrow" >{'>'}</button>}
            outsideChevron
            chevronWidth={chevronWidth}
        >
            <div className="categories" style={{ width: 150, height: 200, background: '#EEE' }}><img src={vintage} /><p>Vintage</p></div>
            <div className="categories" style={{ width: 150, height: 200, background: '#EEE' }}><img src="../../images/categories/consolas.png" /><p>Consolas</p></div>
            <div className="categories" style={{ width: 150, height: 200, background: '#EEE' }}><img src="../../images/categories/libros.png" /><p>Libros</p></div>
            <div className="categories" style={{ width: 150, height: 200, background: '#EEE' }}><img src="../../images/categories/comics.png" /><p>Comics</p></div>
            <div className="categories" style={{ width: 150, height: 200, background: '#EEE' }}><img src="../../images/categories/mesa.png" /><p>Mesa</p></div>
            <div className="categories" style={{ width: 150, height: 200, background: '#EEE' }}><img src="../../images/categories/disfraces.png" /><p>Disfraces</p></div>
            <div className="categories" style={{ width: 150, height: 200, background: '#EEE' }}><img src="../../images/categories/construccion.png" /><p>Construcci√≥n</p></div>
            <div className="categories" style={{ width: 150, height: 200, background: '#EEE' }}><img src="../../images/categories/puzzles.png" /><p>Puzzles</p></div>
            <div className="categories" style={{ width: 150, height: 200, background: '#EEE' }}><img src="../../images/categories/peluches.png" /><p>Peluches</p></div>
            <div className="categories" style={{ width: 150, height: 200, background: '#EEE' }}><img src="../../images/categories/aire-libre.png" /><p>Aire-Libre</p></div>
            <div className="categories" style={{ width: 150, height: 200, background: '#EEE' }}><img src="../../images/categories/teledirigido.png" /><p>Teledirigido</p></div>
            <div className="categories" style={{ width: 150, height: 200, background: '#EEE' }}><img src="../../images/categories/transporte.png" /><p>Transporte</p></div>
            <div className="categories" style={{ width: 150, height: 200, background: '#EEE' }}><img src="../../images/categories/playa.png" /><p>Playa</p></div>
            <div className="categories" style={{ width: 150, height: 200, background: '#EEE' }}><img src="../../images/categories/pelotas.png" /><p>Balones</p></div>
        </ItemsCarousel>
        </div>
    </div>
  );
};
